  "description": "Carl Jacob (Cay) Holmberg was a Swedish naval captain and director born on March 28, 1890 in Varberg to manufacturer Olof H. and Anna Mariana Björnberg. He obtained a navigation officer's certificate in 1910, a naval captain's certificate in 1911, and a reserve officer's certificate in 1912. He was married to Lilly Bengtsson in the 1920s and they had seven children. He worked as a navigation officer and commanding officer on ships owned by Rederi A-B Transatlantic from 1912 to 1922. He then worked as an inspector at Gothenburg's harbor labor office from 1922 to 1935, and was a director there from 1935 onwards. Holmberg was also a member of the city council, the port board, the salary and employment committee, and was chairman of the Swedish Navy's reserve officer association in the district. He was awarded RVO, FFrK, Pro-PatrGM, and EmmeryM honors."
